import React,{useEffect} from 'react';
import {Card} from '@material-ui/core';
import {useStyles} from '../../styles/styles';
import {useDispatch, useSelector} from 'react-redux';
import {LoadProfileAction} from '../../redux/actions/ProfileActions';
import {Link } from "react-router-dom";
import Avatar from '@material-ui/core/Avatar';
import Typography from '@material-ui/core/Typography'

export default function ProfileView() {
  const classes = useStyles();

  const dispatch = useDispatch();

  const profileResponse = useSelector(state=>state.userDetails.userProfile);

  useEffect(() => {
    dispatch(LoadProfileAction());
      return () => {
      
      };
  }, [dispatch])

  return (
    <div className={classes.fullWidthProfile}>
      <Card>
        {
          profileResponse !== "" && profileResponse !== null && profileResponse.success === true ?
          <div>
            <Avatar alt={profileResponse.data.name} 
                    src="/static/images/avatar/1.jpg" 
                    className={classes.centerImage}
                    className="rounded float-end"
            />
          <div className={classes.linkContainer}>
            <Link to="/user/image">Enviar Foto</Link>
          </div>
            <Typography variant="h5" component="h2" className="mt-3 font-weight-normal">
            Nome: {profileResponse.data.name}<p></p>
            Email: {profileResponse.data.email}<p></p>
            Cpf: {profileResponse.data.cpf}<p></p>
            Endereço:{profileResponse.data.address}<p></p>
            </Typography>
          </div>
          :
          <div>Carregando dados...</div>
        }
      </Card>
    <div className={classes.linkContainer}>
      <Link to="/user/address">Cadastrar Endereço</Link>
    </div>
</div>
  );
}
